import React from 'react'; 
import './GamesList.css';


const fs = require('fs');


const GamesList = ({filepath}) => {
	fs.readFile('../'+filepath, 'utf-8', (err, data) => { 
	    if (err) throw err; 

	    // Converting Raw Buffer to text 
	    // data using tostring function. 
	    console.log(data); 
	});
	return '';
}
export default GamesList;
